 at our restaurant and are looking forward to your visit!\r\n\r\nYours\r\n %s', 'Thank you very much for your reservation in our %s.\r\nWith pleasure we confirm your reservation for %s person(s) on %s at %s.\r\n\r\nIf you want cancel your reservation please use your booking number \'%s\' at the homepage.\r\n\r\nWe wish you an enjoyable stay at our restaurant and are looking forward to your visit!\r\n\r\nYours\r\n %s', 'Thank you very much for your reservation in our %s.\r\nWith pleasure we confirm your reservation for %s person(s) on %s at %s.\r\n\r\nIf you want cancel your reservation please use your booking number \'%s\' at the homepage.\r\n\r\nWe wish you an enjoyable stay at our restaurant and are looking forward to your visit!\r\n\r\nYours\r\n %s', '', '', '', '', '非常感谢您在 %s 的预约.\r\n现确认您预约的 %s 位 于 %s 在 %s.\r\n\r\n如果您要取消预约，请在网页内输入您的预约号 \'%s\'.\r\n\r\n我们希望您能喜欢我们的服务并且再次光顾我们!\r\n\r\n\r\n %s'),
