(163, '_email_confirmation', 'Thank you very much for your reservation in our %s.\r\nWith pleasure we confirm your reservation for %s person(s) on %s at %s.\r\n\r\nIf you want cancel your reservation please use your booking number \'%s\' at the homepage.\r\n\r\nWe wish you an enjoyable stay at our restaurant and are looking forward to your visit!\r\n\r\nYours\r\n %s', 'Vielen Dank für Ihre Reservierung in unserem %s.\r\nGerne haben wir für Sie %s Person(en) am %s um %s reserviert.\r\n\r\nWenn Sie Ihre Reservierung stornieren möchten, können Sie dies mit der Buchungsnummer \'%s\' auf der Homepage vornehmen.\r\n\r\nWir wünschen Ihnen einen angenehmen Aufenthalt in unserem Restaurant und freuen uns auf Ihren Besuch!\r\n\r\nBeste Grüße\r\n%s', '', '', 'Hartelijk dank voor uw reservering in ons %s.\r\nGraag bevestigen wij uw reservering voor %s personen op %s om %s\r\n\r\nIndien u uw boeking wilt annuleren, gebruik dan a.u.b.uw reserveringsnummer \'%s\'\r\n\r\nWij wensen u een prettige avond toe in ons restaurant en bedanken u voor uw bezoek.\r\n\r\nMet vriendelijke groeten,\r\n %s', '', 'Tack för er reservation för %s.\r\nVi bekräftar er reservation för %s person/er den %s hos %s.\r\n\r\nVid ändring eller avbokning hänvisa till bokningsnummer: \'%s\'.', 'La ringraziamo per la prenotazione nel nostro %s.\r\nConfermiamo di aver ricevuto una prenotazione per %s persona(e) il %s alle ore %s.\r\n\r\nSe volete annullare la vostra prenotazione vi preghiamo di usare la referenzar \'%s\' usando la pagina precedente.\r\n\r\nCordiali saluti\r\n %s', '', '', '', '', '非常感谢您在 %s 的预约.\r\n现确认您预约的 %s 位 于 %s 在 %s.\r\n\r\n如果您要取消预约，请在网页内输入您的预约号 \'%s\'.\r\n\r\n我们希望您能喜欢我们的服务并且再次光顾我们!\r\n\r\n\r\n %s'),
